const ColorSpace = {
  RGB: 0,
  HSV: 1,
  LAB: 2,
  DIVERGING: 3
};
const Scale = {
  LINEAR: 0,
  LOG10: 1
};
var Constants = {
  ColorSpace,
  Scale
};

export { ColorSpace, Scale, Constants as default };
